// import { useState } from 'react';
import { Link } from 'react-router-dom';

const Home = () => {

    return ( 
        <div className = "home">
           <div className = "black-look">
                <div class = "intro">
                    <p>Welcome to Fresherstrip,</p>
                    <p id = "say">We offer Babcock University 100 level School of Computing and Engineering Sciences and Mass Comm the steps and location to make your signing process faster.<br/><br/>
                    Down here are the eight(8) steps you need to take, click on them to get the directions.</p>                
                </div>
            </div>
            <h1>Steps</h1>
                <div className = "step-preview">
                    <Link to = '/Requirements'><h2>Requirements</h2></Link>
                    <Link to = '/SchoolOfficer'><h2>1. School Officer</h2></Link>
                    <Link to = '/HeadOfDepartment'><h2>2. Head of Department</h2></Link>
                    <Link to = '/BabcockUniversityTeachingHospital'><h2>3. Babcock University Teaching Hospital</h2></Link>
                    <Link to = '/DirectorStudentSupportServices'><h2>4. Director, Student Support Services</h2></Link>
                    <Link to = '/DirectorSecurityServices'><h2>5. Director, Security Services</h2></Link>
                    <Link to = '/Requirements'><h2>6. Data and Archieves Officer</h2></Link>
                    <Link to = '/Requirements'><h2>7. Admissions Officer</h2></Link>
                    <Link to = '/Requirements'><h2>8. School Officer</h2></Link>
                </div>
        </div>
        
        
    );
}
 
export default Home;
